class Solution {

    /**
     * @param Integer $k
     * @param Integer $x
     * @return Integer
     */
    function findMaximumNumber($k, $x) {
        $left = 1;
        $right = PHP_INT_MAX;
        while ($left < $right) {
            $mid = $left + intdiv($right - $left, 2);
            if ($this->sumOfPrices($mid, $x) <= $k) {
                $left = $mid + 1;
            } else {
                $right = $mid;
            }
        }
        return $left - 1;
    }

    private function sumOfPrices($num, $x) {
        $sum = 0;
        for ($i = 1; $i <= $num; ++$i) {
            $binary = decbin($i);
            for ($j = 0; $j < strlen($binary); ++$j) {
                if ($binary[strlen($binary) - $j - 1] === '1' && ($j + 1) % $x === 0) {
                    ++$sum;
                }
            }
        }
        return $sum;
    }
}
